// src/pages/HomePage.tsx
import React from 'react';

const HomePage: React.FC = () => {
  const navigate = useNavigate();

  return (
    <div style={containerStyle}>
      <h1>Dashboard</h1>
      <div style={summaryCardsContainer}>
        <div style={cardStyle}>
          <h2>Products</h2>
          <p>25 Products Available</p>
        </div>
        <div style={cardStyle}>
          <h2>Sales</h2>
          <p>100 Sales Made</p>
        </div>
        <div style={cardStyle}>
          <h2>Low Stock Alerts</h2>
          <p>5 Products Running Low</p>
        </div>
      </div>

      <button onClick={() => navigate('/inventory')} style={buttonStyle}>Go to Inventory</button>
      <button onClick={() => navigate('/sales')} style={buttonStyle}>View Sales</button>
    </div>
  );
};

export default HomePage;
